const strikeText = () => {
    alert('hi');
}

const ToDoItem = (props) => {
    return(
        <li 
            style={{textDecoration: "line-through"}}
            onClick={strikeText}
                >{props.item}
        </li>
    );
}

export default ToDoItem;
